(7857841, 915, 'teste pet', 68, '1', '1', 8, 0, 449, '', 'pets', 'catalog_pet_headline1|', 'Grande, pesado, mamífero que caminha sobre as solas dos seus pés, com pele grossa e uma cauda muito curta. Apaixone-se com a nossa gama adoráveis ursos que incluem o urso e variedades polares | Nome do seu Urso:! | Escolha uma cor: | Escolha uma raça: |'),
