(7857844, 3652245, 'Personalización', 1917, '1', '1', 1, 0, 30, '', 'recycler_info', '', '¡Ya han llegado a Pixeled los prefijos y los nombres de color!|<font color=\"#B22222\" size=\"20\">Prefijos </font> |<b>A la hora de comprar un prefijo debes de aceptar unas normas para evitar ser sancionado. </b>\r\n<br>\r\n<b><font color =\"#B22222\">No está permitido el uso de más de 7 carácteres en el prefijo.\r\n\r\nNo está permitido usar los prefijos suplantando al equipo administrativo, tales como (CEO,ADM,MOD..)\r\n\r\nSi se usa una palabra que no está permitida se cobrará el importe del prefijo y no será entregado, además de ser informado al equipo administrativo de este intento.\r\n\r\nNo está permitido el uso de prefijos ofensivos/racistas o insultos.\r\n\r\nNo está permitido el uso de carácteres molestos visiblemente tales como \"#@€¬/*()=\".\r\n\r\n\r\n </b>\r\n<font size=\"8\"> La compra de un prefijo se da por entendido que has aceptado estas reglas, cualquier staff puede tomar medidas oportunas hacia su cuenta si se ve necesario por un mal uso de los prefijos, así mismo no se aplica un reembolso del coste de los prefijos por el uso inadecuado.</font>\r\n'),
(7857845, 7857844, 'Prefijo', 1917, '1', '1', 1, 0, 347, 'page_link', 'trophies', 'test|colorcustom', 'Ahora Pixeled a traído una nueva actualización, la cual es la personalización de un prefijo exclusivo para tú nombre.\r\n<br>\r\n       • Para borrar tu prefijo (o Tag) ejecuta el comando \"<font color=\"#A52A2A\"><b>:tag remove</b></font>\" o <font color=\"#A52A2A\"><b>Escriba abajo \"off\"</b></font>.\r\n\r\n        No olvides leer las normas para los prefijos, estas normas las puedes encontrar en la página de la categoria \"colores y prefijos\".\r\n\r\n<font size\"9\"> Recuerda que se aplican los espacios. </font>\r\n|Escribe tu prefijo (de 1 a 7 caracteres)'),
(7857846, 7857844, 'Nombre de Color', 164, '1', '1', 1, 0, 299, '', 'default_3x3', 'test|colorcustom', 'Personaliza tu nombre con la gama de colores disponibles en Pixeled'),
