(9123746, 9036, 'Chat Grupo', 164, '1', '1', 1, 0, 75, '', 'guild_forum', 'group_welcome_info|group_welcome_info|group_welcome_info', '¡Los chats de grupo están aquí!|<<i><b><font color=\"#0e3f52\" size=\"16\">¿Qué son los chats de grupo??</font></b></i>\r\n\r\nLos chats de grupo te permiten mantener una conversación con otros usuarios que también estén unidos al grupo, ¡y sin tener que dejar el Hotel!.\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">¿Quién puede iniciar un chat de grupo? </font></b></i>\r\n\r\nSólo un dueño del grupo puede activar un chat para su grupo.\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">¿Necesito un Panel de Chat? </font></b></i>\r\n\r\nNo. Al comprar un chat de grupo no tendrás un panel, solo aparecerá en tu lista de amigos.\r\n\r\n\r\nMás información sobre los chats de grupo pincha <a href=\"event:habbopages/forums\">aquí</a>.\r\n\r\nTenga en cuenta que seguiremos añadiendo más funcionalidades a esta función en un futuro próximo.'),
